	    var high = dateWindow[1];
	
	    // Start from each side of the array to minimize the performance
	    // needed.
	    while (idx < series.length - 1 && series[idx][0] < low) {
	      firstIdx++;
	      idx++;
	    }
	    idx = series.length - 1;
	    while (idx > 0 && series[idx][0] > high) {
	      lastIdx--;
	      idx--;
	    }
